import React from "react";
import "../CSS/task.css";
import tickimage from "../Images/tick.png";
import starimage from "../Images/star.png";

interface taskProp {
  name: String;
  dueDate: Date;
  important: Boolean;
  repeat: Boolean;
  completed: Boolean;
  taskID: String;
}

export function Task({
  name,
  dueDate,
  important,
  repeat,
  completed,
  taskID,
}: taskProp) {
  return (
    <div className="task">
      <div className="task-first-container">
        <div className="tick">
          <img src={tickimage} alt="tick" />
        </div>
        <div>
          <div className="task-first-container-name">UIUX Course</div>
          <div className="task-first-container-date">Wed, 31 may</div>
        </div>
      </div>
      <div className="task-star">
        <img src={starimage} alt="star" />
      </div>
    </div>
  );
}
